(25, 'off', 1, 37, 0, 1, '[\"Chest discomfort\"]', 'Is not He who created the heavens and the earth Able to create the likes of them? Yes, [it is so]; and He is the Knowing Creator.', '[\"2 Days\"]', '', '', '', '', '', 'Can the One Who created the heavens and the earth not ˹easily˺ resurrect these ˹deniers˺?” Yes ˹He can˺! For He is the Master Creator, All-Knowing.\r\n                                                                ', '[{\"general\":\"Afebrile\",\"condition\":\"Severe\"}]', '[{\"examination\":\"3\",\"symptoms\":\"28\"}]', 'All it takes, when He wills something ˹to be˺, is simply to say to it: “Be!” And it is!', 'So glory be to the One in Whose Hands is the authority over all things, and to Whom ˹alone˺ you will ˹all˺ be returned.', 'Can the One Who created the heavens and the earth not ˹easily˺ resurrect these ˹deniers˺?” Yes ˹He can˺! For He is the Master Creator, All-Knowing.', '[\"Cholera due to Vibrio cholerae 01, biovar eltor\"]', '[\"Cholera due to Vibrio cholerae 01, biovar cholerae\",\"Cholera, unspecified\"]', 'So glory be to the One in Whose Hands is the authority over all things, and to Whom ˹alone˺ you will ˹all˺ be returned.                                                                     ', '', '', NULL, 'Tom James', 'OPEN', '2021-06-17 10:44:41'),
(26, 'off', 1, 38, 0, 1, '[\"Fever\"]', 'The history of computer begins with the birth of abacus which is believed to be the first', '[\"2 Days\"]', '', '', '', '', '', '                                                                    ENIAC is generally acknowledged to be the first successful high-speed electronic digital computer (EDC) and was productively used from 1946 to 1955.\r\n                                                                                                                                                                                                ', '[{\"general\":\"Afebrile\",\"condition\":\"Mild\"}]', '[{\"examination\":\"2\",\"symptoms\":\"15\"}]', 'The history of computer begins with the birth of abacus which is believed to be the first computer. It is said that Chinese invented Abacus around 4,000 years ago', 'The following brief history of computing is a timeline of how computers evolved from their humble beginnings to the machines of today.', 'computer - computer - History of computing: A computer might be described with deceptive simplicity as “an apparatus that performs routine calculations ...', '[\"Cholera, unspecified\"]', '[\"Typhoid fever\",\"Paratyphoid fever A\"]', '                                                                        History of computing hardware — Charles Babbage, an English mechanical engineer and polymath, originated the concept of a programmable                                                                                                                                                                                                             ', '', '', NULL, 'Tom James', 'OPEN', '2021-06-18 12:27:51'),
(27, 'off', 1, 39, 0, 1, '[\"Chest discomfort\",\"Pain\"]', 'For most of the production, the ingrates seem to possess an idealised beauty only visible through the words of others. ', '[\"3 Days\",\"1 Week\"]', '', '', '', '', '', 'No more high-revving VTEC four-cylinder and slick manual transmission for you ingrates, because—wait, hold on a moment.\r\n                                                                ', '[{\"general\":\"Not pale\",\"condition\":\"Mild\"}]', '[{\"examination\":\"3\",\"symptoms\":\"28\"}]', 'The ingrates remain silent in the face of everyone else\'s descriptions of them. ', 'These examples are from corpora and from sources on the web. Any opinions in the examples do not represent the opinion of the Cambridge Dictionary editors or of Cambridge University Press or its licensors. ', 'By clicking “Accept All Cookies”, you agree to the storing of cookies on your device to enhance site navigation, analyze site usage, and assist in our marketing efforts. Privacy and Cookies Policy', '[\"Cholera, unspecified\"]', '[\"Typhoid fever\",\"Typhoid and paratyphoid fevers\"]', '                                                                                                                                                                                                                        For years after 9/11, Republicans defended the intelligence community against civil libertarians and intervention-skeptical Democrats, attacking critics of the FBI and CIA as unpatriotic ingrates.                                                                                                                                                                                                                                                                                  ', '', '', NULL, 'Tom James', 'OPEN', '2021-06-21 11:12:28'),
(28, 'off', 9, 40, 0, 1, '[\"Headaches\",\"Breathlessness\"]', 'Helps in Life issues', '[\"1 Week\",\"2 Weeks\"]', '', '', '', '', '', 'Complete Translation of Sura al Yasin · All come up before God, willingly or otherwise · Sign of Qiyamat—enlivening of a dead earth · From a grain of wheat, he ...\r\n                                                                ', '[{\"general\":\"Pale\",\"condition\":\"Severe\"}]', '[{\"examination\":\"5\",\"symptoms\":\"39\"}]', 'Reciting The Yaseen every day helps you solve the problems of this worldly life and eases the tests of life or a life partner.', 'The recitation invokes the blessing of Allah SWT on the reciter. This surah is also known for abolishing multiple fears from the heart.', 'Yā Sīn is the 36ᵗʰ chapter of the Quran. It has 83 verses. It is regarded an earlier \"Meccan surah\". Some scholars maintain that verse 12 is from the Medinan period. While the surah begins in Juz 22, most of it is in Juz 23. The surah begins with the eponymous Arabic letters', '[\"Paratyphoid fever, unspecified\"]', '[\"Localized salmonella infections\",\"Shigellosis\"]', 'Helps in Life issues ... Reciting The Yaseen every day helps you solve the problems of this worldly life and eases the tests of life or a life partner.                                                                 ', '', '', NULL, 'Tom James', 'OPEN', '2021-06-22 13:22:53'),
