(58, '1', '', 'Alarming Symptom - Stress Headache -> Self Treatment may be enough', 'Recommendation\r\nUsually, your symptoms don’t require medical care and they may resolve on their own. You may try to manage your condition with home remedies. If your symptoms get worse or new symptoms appear, consult a doctor immediately.', 'The lab test below are not related to your symptoms. However, they are recommended due to your risk profile\r\n1. Morphology and urinalysis\r\n2. Total cholesterol1. Morphology and urinalysis\r\n2. Total cholesterol', 'Avoid stress & have proper bed rest.', 1, '2020-08-06 00:00:00');
